@app.route('/info/<id>')
def noticia(id):
    for i in lista_noticias:
        if int(i.get_id()) == int(id):
            return render_template('info.html', noticia=lista_noticias[int(id)], estados=lista_estados)
    return render_template('erro.html')


@app.route('/estado/<string:uf>')
def noticia_estado(uf):
    noticia_estados = []
    for estado in lista_estados:
        if estado.get_uf() == uf:
            for i in lista_noticias:
                if i.get_estado().get_uf() == uf:
                    noticia_estados.append(i)
            print(noticia_estados)
            return render_template('estados.html', noticia_estado=noticia_estados, estados=lista_estados)
    return render_template('erro.html')

